// Packages & Libs
import styled from "styled-components";

// Box Component
import Box from "./Box";

// Files
import exercise from "../images/icon-exercise.svg";
import play from "../images/icon-play.svg";
import selfCare from "../images/icon-self-care.svg";
import social from "../images/icon-social.svg";
import study from "../images/icon-study.svg";
import work from "../images/icon-work.svg";

// Style
const Parent = styled.article`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  gap: 95px;
  align-items: center;
  justify-content: center;

  .top-row,
  .bottom-row {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-wrap: wrap;
    gap: 30px;
  }

  @media screen and (max-width: 1200px) {
    gap: 70px;

    .top-row,
    .bottom-row {
      flex-wrap: nowrap;
    }
  }

  @media screen and (max-width: 576px) {
    flex-direction: column;
    gap: 75px;

    .top-row,
    .bottom-row {
      flex-wrap: wrap;
      flex-direction: column;
      gap: 75px;
    }
  }
`;

const Monthly = () => {
  return (
    <Parent>
      <div className="top-row">
        <Box
          top="Work"
          title="75hrs"
          bottom="Last Month - 78hrs"
          icon="/images/icon-work.svg"
          color="#ff8b64"
        />
        <Box
          top="Play"
          title="15hrs"
          bottom="Last Month - 13hrs"
          icon="/images/icon-play.svg"
          color="#56c2e6"
        />
        <Box
          top="Study"
          title="7hrs"
          bottom="Last Month - 14hrs"
          icon={study}
          color="#ff5e7d"
        />
      </div>
      <div className="bottom-row">
        <Box
          top="Esercise"
          title="8hrs"
          bottom="Last Month - 30hrs"
          icon={exercise}
          color="#4acf84"
        />
        <Box
          top="Social"
          title="13hrs"
          bottom="Last Month - 15hrs"
          icon={social}
          color="#7235d1"
        />
        <Box
          top="Self Care"
          title="3hrs"
          bottom="Last Month - 3hrs"
          icon={selfCare}
          color="#f1c75b"
        />
      </div>
    </Parent>
  );
};

export default Monthly;
